import React, { useEffect, useState } from "react";
import axios from "axios";
import "./App.css";

const App = () => {
  const [student, setStudent] = useState([]);
  const loadStudent = () => {
    axios
      .get("http://localhost:5000/api/getInfo", {
        params: {
          _limit: 10,
        },
      })
      .then(({ data }) => {
        console.log(data);
      });
  };
  useEffect(() => {
    loadStudent();
  }, []);
  return (
    <div>
      <h1>Hi</h1>
    </div>
  );
};

export default App;
